import jsPDF from "jspdf";
import "jspdf-autotable";
import { Subscript } from "lucide-react";
import { blob } from "stream/consumers";

export async function createPdf(_listing: any): Promise<Blob> {
    const doc = new jsPDF(); // generate doc w default (portrait, mm units, a4 size,...)

    // uses splitTextToSize to format the title into multiple lines so it doesnt just continue past the page end
    const splitTitle = doc.splitTextToSize(`${_listing.name} Data Processor Listing`, 120);
    const textHeight = doc.getTextDimensions(splitTitle).h*1.5;

    // title formatting
    doc.setFont('helvetica');
    doc.setFontSize(24);
    doc.text(splitTitle, 15, 15);

    // Logo:
        // generated logo as base64
    const kmdLogo = 'data:image/png;base64,';
    const pageWidth = doc.internal.pageSize.getWidth();     // gets page width and sets the logo in the corner
    doc.addImage(kmdLogo, 'png', pageWidth-25, 0, 23, 13);  //hardcoded pos cus y not


    //TABLE FORMATTING:

    const columns = ["Category", "Label", "Data"];      // Columns for the table
    const listingData = formatListingData(_listing);    // Use helper function to format data 
    // Generate the table using autoTable
    doc.autoTable({ //ignore error, it works
        head: [columns],
        body: listingData,
        styles: {   //default style
            font: 'helvetica',
            fontSize: 9
        },
        headStyles: {   //header styles
            fontSize: 11,
            fontStyle: "bold",
            fillColor: "#1f614e",
            textColor: "#d9d9d9"
        },
        startY: 15 + textHeight, // Start table below title
    });

    // Save the PDF file
    const fileName = `${_listing.name} listing.pdf`;
    doc.save(fileName);
    const blobPDF = new Blob( [ doc.output('blob') ], { type: 'application/pdf' } ); // outputs the pdf as a blob w MIME/media type pdf
    
    return(blobPDF);
}

// Helper function to format all data
function formatListingData(listing: any){
    if (!listing) return "N/A";
    
    // Base data (contact and data categories)
    const data = [
        ["Contact", "Data Controller", formatContact(listing["dataController"])],
        ["", "Data Processor", formatContact(listing["dataProcessor"])],
        ["", "Data Processor Representative", formatContact(listing["dataProcessorRepresentative"])],
        ["", "Data Security Adviser", formatContact(listing["dataSecurityAdvisor"])],
        ["Data Categories", "Categories of data", formatDataCategories(listing["dataCategories"])]
    ];
    console.log(listing);

    //Data Transfer:
    let transferData = [
        ["Transfer of data", "Terms of data transfer and sub-processors recieving data", listing.dataTransfer.transferInformation]
    ]
    for (const subProcessor of listing.dataSubProcessors) {
        // Ensure that subProcessor has the properties you want to access
        const transferInfo = [`Reason: ${subProcessor.transferReason}`, `Treatment: ${subProcessor.treatment}`].filter(item => item !== 'N/A').join("\n\n")
        transferData.push(["", subProcessor.name, transferInfo])
    }



    return [...data, ...transferData];
}

// Helper function to format contact information
function formatContact(contact: any): string {
    if (!contact) return "N/A";
    return [
        contact.name,
        contact.address,
        contact.phoneNo,
        contact.mail,
        contact.cvr
    ]
        .filter(Boolean) // Filter out undefined or null values (cus sometimes the contact exists without one or more of the variables)
        .join("\n");
}

// Helper function to format data categories
function formatDataCategories(dataCategories: any): string {
    if (!dataCategories?.categoryList) return "N/A";
    return dataCategories.categoryList.split(", ").map((category: string) => `- ${category}`).join("\n"); //splits into an array, formats and joins the list back to one string
}
